$(`body`).on('click', '.select_fare', function () {
    const $this = $(this)
    const _sequence = $this.attr('sequence')
    console.log(CatalogProductsSelected)
    CatalogProductsSelected = CatalogProductsSelected?.filter(a => a.sequence !== _sequence);
    CatalogProductsSelected.push({ sequence: _sequence, CatalogProductOfferingsID: $this.attr('CatalogProductOfferingsID'), CatalogProductOfferingID: $this.attr('CatalogProductOfferingID'), ProductId: $this.attr('ProductId') })
    if (CatalogProductsSelected.length > 0) {

        $("#selected_product").addClass('d-flex').removeClass('d-none')
        CatalogProductsSelected.sort((a, b) => a.sequence - b.sequence)

        $("#selected_product .selected_product_holder").html(``)
        var tPrice
        CatalogProductsSelectedCount = 0
        CatalogProductsSelected?.forEach((CatalogProductSelected) => {
            CatalogProductsSelectedCount++
            const CatalogProductOfferingID = CatalogProductSelected.CatalogProductOfferingID
            const ProductId = CatalogProductSelected.ProductId
            const Product = ReferenceList[ProductId]

            tPrice = tPrice + (ProductOffering[CatalogProductOfferingID]?.Price?.TotalPrice + ProductOffering[CatalogProductOfferingID]?.Price?.TotalPrice)
            var dept = { 'date': ReferenceList[Product.FlightSegment[0].Flight.FlightRef].Departure.date, 'time': (ReferenceList[Product.FlightSegment[0].Flight.FlightRef].Departure.time).substr(0, 5) }
            var arri = { 'date': ReferenceList[Product.FlightSegment[(Product.FlightSegment.length - 1)].Flight.FlightRef].Arrival.date, 'time': (ReferenceList[Product.FlightSegment[(Product.FlightSegment.length - 1)].Flight.FlightRef].Arrival.time).substr(0, 5) }

            $("#selected_product .selected_product_holder").append(`
                <div class="flight__detail-inner px-4 flex-fill">
                    <div class="bp_flight_title fw-bold mb-3 fs-5">Departing <span><a href="#" class="link-primary text-decoration-underline link-offset-2 fw-semibold ms-2 fs-6">Change Flight</a></span></div>
                    <div class="bp-flight-content d-flex">
                        <div class="bp-flight_description">
                            <div class="bp-flight_date fs-6">${tp_dateformat(dept.date)}</div> 
                            <div class="bp-flight_hour fw-bold fs-4"><span>${ProductOffering[CatalogProductOfferingID].Departure} ${dept.time}</span></div>
                        </div>
                        <div class="bp-flight-content-wrap px-3 text-center">
                            <i class="mdi mdi-arrow-right-thin fs-4"></i> 
                            <div class="bp-flight-time fs-6">${tp_duration(Product.totalDuration)}</div>
                        </div>
                        <div class="bp-flight_description">
                            <div class="bp-flight_date fs-6">${tp_dateformat(arri.date)}</div> 
                            <div class="bp-flight_hour fw-bold fs-4"><span>${ProductOffering[CatalogProductOfferingID].Arrival}  ${arri.time}</span></div>
                        </div>
                    </div>
                </div>
                `)
        })
        $("#selected_product").find('.act').remove()
        if (tp_search_params.journeytype == 'oneway') {
            $("#selected_product").append(`
                <div class="right-info col-md-3 d-flex align-items-center justify-content-around act">
                    <div>
                        <p class="mb-0">Total Fare (1 People)</p>
                        <div class="fw-bold fs-3 text-primary"><span>$</span>${tPrice}</div>
                    </div>
                    <button type="button" class="btn btn-primary" id="doPrice" >Confirm & Add Pax\s</button>
                </div>
                `)
        } else if (tp_search_params.journeytype == 'return') {
            if (CatalogProductsSelectedCount == 1) {

                $("#selected_product").append(`
                    <div class="right-info col-md-3 d-flex align-items-center justify-content-around act">
                    <div>
                    <p class="mb-0">Total Fare (1 People)</p>
                    <div class="fw-bold fs-3 text-primary"><span>$</span>${tPrice}</div>
                    </div>
                    <button type="button" class="btn btn-primary" id="searchNextLeg" >Next Leg</button>
                    </div>
                    `)
            } else if (CatalogProductsSelectedCount == 2) {
                $("#selected_product").append(`
                    <div class="right-info col-md-3 d-flex align-items-center justify-content-around act">
                        <div>
                            <p class="mb-0">Total Fare (1 People)</p>
                            <div class="fw-bold fs-3 text-primary"><span>$</span>${tPrice}</div>
                        </div>
                        <button type="button" class="btn btn-primary" id="doPrice" >Confirm & Add Pax\s</button>
                    </div>
                    `)
            }
        }
    } else {
        $("#selected_product").addClass('d-none').removeClass('d-flex')
    }
    //alert(1)
});

